import { SearchPage } from "components/pages/SearchPage";
import { ReactNode } from "react";
import { CurrentTabType } from "store/atoms/currentTabState";

export const ALL_TABS: {tabId: CurrentTabType, page: ReactNode }[] = [
  {
    tabId: 'about',
    page: SearchPage,
  }
]
